description:
19 year old Alice sits with her sister, reading a strangely erotic book, when there appears a White Rabbit. Alice follows the rabbit down a well and finds herself in Wonderland, a place of excitement and pleasure. The White Rabbit suggests that Alice comes with her to &quot;The Hole&quot;, the most popular nightclub in Wonderland. Along their way Alice encounters many curious beings, including The Caterpillar, The Cheshire Cat, The evil Queen, and even stumbles into a Mad Hatter's tea party. Each encounter leads Alice closer to understanding the true wonder of Wonderland...

